(723, 'https://www.instagram.com/p/CAuGDCRJLig/', 85924, 891, '2020-05-28-12', 'ðŸ˜£ man my heart aches #racism reposted â€¢ @drcarolineleaf like a toxic mindset that has been strengthened by constant negative thinking over the years and taken over someoneâ€™s life, affecting their mental and physical health, racism is one of our societyâ€™s most toxic mindsets. it has been practiced through the way we speak, think and behave. it has become ingrained in the very fabric of our societyâ€”to the extent that many of us either ignore or accept it, or donâ€™t even recognize it allâ€”till it is too late. till someone is falsely accused, attacked, hunted or killed. racism affects the health of all of us: whether we are victimized by it and live in fear of it, or are polluted by it, intentionally or otherwise. and like any toxic mindset, it wonâ€™t go away, it wonâ€™t stop killing us, unless we acknowledge it, face it in all its ugliness, and admit that things need to change. admit that we need to change.yes, this can be uncomfortable. and yes, it means that we have to face parts of ourselves that we maybe didnâ€™t even know were there. it means apologizing for, changing, and challenging social structures that keep the few in power and the many without power. this is the only way love can start conquering anythingâ€”in ourselves and in our world.  unless we all say something, unless we all recognize the need to change, we will get nowhere as a people racism harms us all. this is not a political statement. this is a scientific and social reality. we are entangled in each others lives. when this entanglement is characterized by subconscious and conscious prejudices and hatred, we are a toxic society. but when our entanglement is characterized by love and respect,Â Â we can all be ourselves and go places as a society we have never truly imagined. as marian anderson once said, â€œno matter how big a nation is, it is no stronger than its weakest people, and as long as you keep a person down, some part of you has to be down there to hold him down, so it means you cannot soar as you might otherwise.â€ but i do have hope. i do believe that things can get betterâ€”human beings are nothing if not resilient, and the the human mind has an infinite capacity to change,heal,grow and bloom', 'GraphSidecar', 'agnezmo', 85, 2964, 22200000, 2020, 5, 28, 12, 202005, '0.387045045', '0.004013514', '0.391058559', 2195, 2130, 65, 392, '0.178587699', 0),
