(1399, 'https://www.instagram.com/p/Bj1ndINnVBF/', 11142, 1661, '2018-06-10-15', 'tak terasa hari ini tepat setahun lalu kakak tercinta jupe @juliaperrezz  meninggalkan kami. senyuman dan kebaikannya masih membekas di dalam hati kami dan tidak akan pernah terlupakan selama-lamanya.  salah satu permintaan kak jupe adalah vaksinasi hpv dan alhamdulillah aku sudah menyelesaikannya dan sebentar lagi adikku akan menyusul. aku harap semakin banyak perempuan indonesia yang terlindungi dari virus hpv penyebab kanker serviks .----- semoga kisahnya dapat menjadi pengingat bagi perempuan indonesia untuk lebih peduli pada kesehatan pribadi dan melakukan tindakan pencegahan kanker serviks dengan deteksi dini dan vaksinasi hpv. ---kunjungi www.cegahkankerserviks.org untuk mengetahui lebih lanjut mengenai berbagai upaya pencegahan kanker serviks bagi diri dan keluarga.#cegahkankerserviks #cervicalcancer#vaksinasihpvsegera #cervicalcancercannotbeatme #vaccineswork #kicks005 #setahunjuliaperez #brownis #transt @cegahkankerserviks_id', 'GraphVideo', 'juliaperrezz', 641, 8757, 14700000, 2018, 6, 10, 15, 201806, '0.075795918', '0.011299320', '0.087095238', 949, 921, 28, 114, '0.120126449', 0),
