(1686, 'https://www.instagram.com/p/B90nQLjBNKR/', 153560, 935, '2020-03-17-11', '⁣mengapa 14 hari dan untuk apa, maklum himbauan itu tanpa disertai penjelasan yg memadai.⁣⁣⁣⁣begini,⁣⁣- ketika seseorang kontak dengan apapun yg bisa menginfeksinya dengan covid-19, maka harus ditunggu 14 hari minimal, jika tidak terjadi apa-apa, maka orang itu aman.⁣⁣- libur 14 hari untuk memotong rantai penularan, ini baru akan berhasil jika semua orang *tetap* tinggal di rumah masing-masing selama 14 hari itu, kenapa harus begitu?⁣⁣⁣⁣contoh:⁣⁣seorang anak mulai libur tanggal 16 maret selama 14 hari, dia akan masuk sekolah lagi pada hari ke-15. ternyata anak ini dan keluarganya menggunakan waktu libur itu untuk jalan-jalan, mengunjungi kumpulan orang, ketempat saudara, ke mal dll, seandainya dia jalan-jalan di hari ke-10 dan terlular covid-19 di tempat yg ia kunjungi, mungkin pada hari ke 14/15 belum ada tanda-tanda dia sakit, tetapi dia sudah membawa covid-19 di tubuhnya dan berpotensi menularkan, andai dia masuk sekolah pada hari ke-15 dst. maka 14 hari libur sekolahnya itu tidak ada gunanya, penularan terjadi juga di sekolah, efek domino akan berlangsung, rantai penularan tidak terputus.⁣⁣⁣⁣untuk itu, semua orang harus bekerja sama, semua warga indonesia harus membantu, warga harus kompak, yaitu patuh untuk tidak kemana-mana dalam 14 hari itu kecuali untuk hal yang sangat perlu.⁣⁣⁣⁣waktu 14 hari itu, berguna untuk saling pantau, jika ada orang yg menunjukkan gejala-gejala menderita serangan covid-19, bisa segera ditangani dan penularan stop hanya pada dia, karena dia tidak kontak dengan orang lain dalam 14 hari itu.⁣⁣jadi, mari kita mengisolasi diri, untuk diri sendiri dan orang lain, mungkin pula dalam skala besar untuk umat manusia.⁣⁣⁣⁣mohon jelaskan kepada orang lain, supaya semua patuh dan pemerintah terbantu untuk stop penularan covid-19, jika tidak, maka 14 hari libur itu percuma, 14 tahun pun tak bisa stop penularan.⁣⁣⁣⁣semoga kondisi dunia segera pulih. ?⁣⁣-dr reisa broto 