(1961, 'https://www.instagram.com/p/CBcM3DPph1I/', 66081, 984, '2020-06-15-10', 'pembukaan pesantren di akb jawa barat.sesuai arahan dan aspirasi para kiayi, pemprov jabar taat pada aspirasi tersebut, dan memulai menyiapkan pembukaan pesantren selama akb.1. karena kekhususannya, maka pesantren di zona biru dan hijau, sesuai arahan para kiyai, akan dibuka lebih dahulu ketimbang sekolah umum.2. gugus tugas menugaskan wagub uu ruzhanul umum @ruzhanul untuk mendiskusikan poin2 protokol persiapannya dengan forum pesantren yang diwakili 79 kiayi.3. pak wagub kemudian beberapa kali vcon bersama 79 kiayi perwakilan pesantren tersebut membahas poin-poin peraturan. sehingga akhirnya terjadi kesepakatan protokol kesehatan dan keselamatan pembukaan pesantren saat akb.4. kesepakatan tersebut kemudian menjadi dasar keputusan gubernur yang dirilis kemudian. namun setelah dirilis ternyata masih ada dinamika di lapangan, walaupun sudah disepakati dengan para kiyai perwakilan.5. pemprov memahami aspirasi tambahan tersebut, dan kep gubernur hari ini sudah direvisi untuk mengakomodir semua suara yang berkepentingan.6. semua niatan protokol ini semata-semata agar keselamatan jiwa santri dan kiayi bisa dijaga dengan maksimal selama pandemi covid ini. dan agar orangtua para santri juga tenang dalam mengirim anak2nya kembali belajar di pesantren di jawa barat.hatur nuhun.', 'GraphImage', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 15, 10, 202006, '0.528648000', '0.007872000', '0.536520000', 1289, 1261, 28, 172, '0.133436773', 2),
