(1968, 'https://www.instagram.com/p/CBW1D7OpRPi/', 57202, 1154, '2020-06-13-08', 'banyak yang salah paham,psbb itu dilanjut hanya untuk zona kuning (30% wilayah). itu pun tidak seluruh wilayahnya alias proporsional, berbasis desa/kelurahan yang merah/. ada kelurahan/desa yang melakukan jika merah atau hitam, ada juga yang tidak jika sdh biru atau hijau. artinya psbb proporsional itu disesuaikan level kewaspadaan mikro.psbb bisa tidak dilanjut di zona biru (70 persen wilayah). kegiatan sudah bisa buka 90% (minus pendidikan), dengan bertahap dan agresif sidak testing covid di kerumunan2.', 'GraphImage', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 13, 8, 202006, '0.457616000', '0.009232000', '0.466848000', 510, 489, 21, 73, '0.143137255', 0),
(1969, 'https://www.instagram.com/p/CBVXwBdJwH1/', 98243, 3061, '2020-06-12-18', 'update level kewaspadaan 2 mingguanselama 2 minggu, ada 3 wilayah (kab bandung, subang dan cimahi) membaik dari zona kuning ke zona biru. 1 wilayah zona biru (garut) turun ke zona kuning.total zona biru naik menjadi dari 15 menjadi 17 wilayah. dan total zona kuning turun dari 12 menjadi 10 wilayah. wilayah bodebek masih kuning dan bandung raya, tinggal kota bandung yang masih kuning.yang zona kuning diarahkan untuk makaimal menggempur desa/kelurahan yang masih tinggi tingkat penularannya selama 2 minggu ke depan.semoga secepatnya ada yang menjadi zona hijau.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 12, 18, 202006, '0.785944000', '0.024488000', '0.810432000', 564, 549, 15, 86, '0.152482270', 9),
(1970, 'https://www.instagram.com/p/CBUMcQkJft3/', 167226, 2285, '2020-06-12-07', 'pengecekan akb di pangandaran,hanya yang sudah rapid tes yang bisa mengakses pantai pangandaran selama adapatasi kebiasaan baru tahap awal dan sementara hanya untuk warga jawa barat dulu. warga pangandaran tentunya bebas.hotel juga sudah melaksanakan protokol covid termasuk adanya manager covid yang bertugas khusus. dan makan tidak boleh ngambil sendiri, dibantu khusus oleh staf saji.kurang nyaman tapi demi keselamatan.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 12, 7, 202006, '1.337808000', '0.018280000', '1.356088000', 423, 416, 7, 58, '0.137115839', 0),
(1971, 'https://www.instagram.com/p/CBSy3c9J_T-/', 113732, 1462, '2020-06-11-18', 'program swab test masif & pembatasan sosial skala mikro di 54 desa zona merah dimulai. .saya bersama wabup garut mengawal pengetesan swab pcr kepada 160 warga desa samida di kec sela awi garut. 627 mobil covid tes lainnya terus melakukan sidak di kerumunan2 se jawa barat. total tes swab/rapid sdh 200 ribu warga. .kamsasamida dari desa samida. semoga jabar selalu terus terkendali', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 11, 18, 202006, '0.909856000', '0.011696000', '0.921552000', 381, 372, 9, 62, '0.162729659', 4),
(1972, 'https://www.instagram.com/p/CBR8KicgGwv/', 160924, 4388, '2020-06-11-10', 'inilah kenapa parasmanan dilarang selama pandemi dan akb.eksperimen di jepang. satu pengunjung yang diasumsikan kena covid diberi cairan fluorescence di tangan. dalam 15 menit semua sudah terkena cairan tersebut...karenanya restoran/cafe/hotel/resepsi dilarang menyajikan dengan sistem saji parasmanan atau buffet. kalo pun ada, harus dilayani oleh petugas khusus bersarung tangan dan bermasker plus face shield.sehingga pengunjung tidak silih pegang piring sajian makanan atau sendok sajian.mohon para pemilik restoran/cafe/eo acara memahami ini.', 'GraphVideo', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 11, 10, 202006, '1.287392000', '0.035104000', '1.322496000', 547, 531, 16, 69, '0.126142596', 1);
