(1973, 'https://www.instagram.com/p/CBPFGzWJVlO/', 172214, 7052, '2020-06-10-08', 'sekolah gratis mulai tahun ajaran baru juli 2020 ini.kabar gembira untuk para orang tua siswa sma/smk/slb. sekolah2 ini sesuai kewenangan provinsi.walau ekonomi jatuh oleh covid, namun pemprov jabar sesuai komitmen tetap menganggarkan 1,42 trilyun untuk sekolah gratis berupa pembebasan biaya iuran bulan peserta didik (ibpd) atau dulu disebut spp.untuk siswa sekolah swasta dan ma diberi bantuan walau tidak penuh. dan atas nama sila ke-5, siswa tidak mampu yang bersekolah di swasta akan diberi bantuan penuh.untuk mahasiswa jabar kuliah di jabar, silakan akses beasiswa total 29 milyar. silakan tanya ke pt masing2. .semoga cerita bersejarah untuk jawa barat ini akan membawa lompatan bagi kemajuan masa depan jawa barat.hatur nuhun.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 10, 8, 202006, '1.377712000', '0.056416000', '1.434128000', 736, 716, 20, 108, '0.146739130', 2),
(1974, 'https://www.instagram.com/p/CBNz4zXgtcb/', 75066, 3169, '2020-06-09-20', '25 tahun yang lalu.satu-satunya video dari sahabat saya, tentang wisuda saya saat tahun 1995, bersama para wisudawan arsitektur itb angkatan 1990. saya yang tengil item dan banyak cakap dan berat badannya lebih ringan 15 kg. efek 4 bulan nginep di kampus mengerjakan tugas akhir.setahun kemudian menikah dengan @ataliapr karena cinta pada pandangan pertama di jalan braga. dan dikarunia 2 anak sholeh dan sholehah. anak pertama sekarang meneruskan kuliah di teknik mesin di kampus yang sama.gubernur jawa barat saat itu mayjen pur. rn nuriana.', 'GraphVideo', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 9, 20, 202006, '0.600528000', '0.025352000', '0.625880000', 543, 530, 13, 83, '0.152854512', 4),
(1975, 'https://www.instagram.com/p/CBMswdbp8sP/', 63452, 1326, '2020-06-09-09', 'awal minggu ini indeks reproduksi covid di jawa barat terkendali di sekitar 0,72. selama 1 bulan rata-rata di bawah 1. berada di urutan ke-4 terendah dari seluruh provinsi. .menjaga indeks ini, testing akan ditingkatkan di 700-an pasar, tempat wisata dan desa2 yg masih zona merah.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 9, 9, 202006, '0.507616000', '0.010608000', '0.518224000', 281, 270, 11, 45, '0.160142349', 1),
(1976, 'https://www.instagram.com/p/CBMjwywJ__i/', 99042, 2924, '2020-06-09-08', '3 pasar ditutup,karena pedagang dan pembeli tidak disiplin pake masker, sehingga ditemukan ada yg terpapar. jika sudah begini yang dirugikan masyarakat kembali.700 pasar akan digempur covid test selama 2 minggu ini, karena kajian sementara sumber problem covid di jabar saat ini ada di pasar. .3 jurus selamat dari covid:1. pake masker2. jaga jarak.3. cuci tangan.tong nepaan. tong katepaan. mari disiplin.', 'GraphImage', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 9, 8, 202006, '0.792336000', '0.023392000', '0.815728000', 406, 390, 16, 60, '0.147783251', 2),
(1977, 'https://www.instagram.com/p/CBKtK26gkln/', 34472, 636, '2020-06-08-15', 'selamat hari laut sedunia,mari cintai laut dan segala ekosistem di dalamnya. karena indonesia yang 77% wilayahnya laut adalah anugerah allah swt yang luar biasa. juga jangan lupa mari budayakan untuk sering makan ikan laut, agar masyarakat kita bisa sehat dan panjang umur seperti bangsa jepang yang rajin mengonsumsi ikan laut. (foto tahun 2010)', 'GraphVideo', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 8, 15, 202006, '0.275776000', '0.005088000', '0.280864000', 346, 338, 8, 53, '0.153179191', 0),
(1978, 'https://www.instagram.com/p/CBKL7m2JRF3/', 44359, 958, '2020-06-08-10', 'berita bahagia non-covid.alhamdulillah, inovasi-inovasi desa digital jawa barat memenangkan award inovasi smartcity asia pacific 2020, menyisihkan saingan dari selandia baru dan australia dalam kategori digital equity dan accessibility.pasca covid, keberadaan ekonomi desa menjadi sangat strategis jika diberi percepatan oleh revolusi digital atau teknologi informasi. dengan bantuan revolusi digital, tinggal di desa tapi rejeki kota dan bisnis mendunia.mari semangat wahai warga desa-desa jawa barat.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 8, 10, 202006, '0.354872000', '0.007664000', '0.362536000', 502, 490, 12, 63, '0.125498008', 0),
(1979, 'https://www.instagram.com/p/CBIvBoLAigo/', 23146, 404, '2020-06-07-21', 'saya baik-baik saja kang yanna marvels, walau keputusan terbaik terkait covid yang diambil sering pahit dan tidak populis. di masa sulit ini juga harus lebih sabar tawakal dan lebih banyak mendengar.hatur nuhun untuk kang @yannahead dan @eko_oray. .hati2 ada penampakan.', 'GraphVideo', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 7, 21, 202006, '0.185168000', '0.003232000', '0.188400000', 270, 261, 9, 40, '0.148148148', 0),
(1980, 'https://www.instagram.com/p/CBHsrH-JFw3/', 147593, 1757, '2020-06-07-11', 'menikah di saat covid.yang utama dan terpenting adalah syariat terpenuhi dengan rukun nikah dan ijab kabulnya. lain-lain bisa menyesuaikan sesuai situasinya, termasuk saya memberikan khotbah nikah secara virtual.semoga semua pasangan yang menikah selama pandemi covid diberi allah kemudahan dan kelanggengan atas pernikahannya. aamiin.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 7, 11, 202006, '1.180744000', '0.014056000', '1.194800000', 335, 328, 7, 43, '0.128358209', 0),
(1981, 'https://www.instagram.com/p/CBHf6L4Ajkl/', 34303, 861, '2020-06-07-09', 'terkait covid-19 jawa barat. sebagain besar berita baik, sebagian lagi berita kurang baik.yang sudah baik dipertahankan, yang kurang baik disempurnakan.ingat 3 rumus melawan covid:1. jaga jarak.2. pakai masker3. cuci tangan.', 'GraphVideo', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 7, 9, 202006, '0.274424000', '0.006888000', '0.281312000', 224, 212, 12, 30, '0.133928571', 1),
(1982, 'https://www.instagram.com/p/CBGOlJGAgkT/', 46610, 1361, '2020-06-06-21', '“jaga perasaan itu penting, tapi saat covid, jaga jarak lebih penting” — #fatwacinta', 'GraphVideo', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 6, 21, 202006, '0.372880000', '0.010888000', '0.383768000', 84, 78, 6, 13, '0.154761905', 0),
(1983, 'https://www.instagram.com/p/CBFt2mGJx-j/', 232090, 2664, '2020-06-06-16', 'monumen bung karno di kota algiers di aljazair, afrika utara.hari ini hari lahir bung karno. sosok manusia segala bisa atau multidimensi. insinyur arsitek, seniman, pendiri partai, penulis buku, pejuang, proklamator, presiden dll.sosok yang menjadi inspirasi kita juga bangsa di luar indonesia seperti halnya algeria.abad-abad lalu kita sempat ditaklukkan dunia, maka abad-abad esok kitalah yang menaklukkan dunia.maka jadilah kita seperti bung karno, menjadi manusia multi dimensi yang adaptif dan kompetitif dengan kepribadian pancasila.doa terbaik kita haturkan untuk bung karno di hari lahirnya ini.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 6, 16, 202006, '1.856720000', '0.021312000', '1.878032000', 603, 584, 19, 82, '0.135986733', 0),
(1984, 'https://www.instagram.com/p/CBE3ZKkJmva/', 52993, 1303, '2020-06-06-08', 'panduan,adaptasi kebiasaan baru di 30 jenis kegiatan atau (akb30) di 5 level kewaspadaan. ikuti agar kita selamat dari covid.dalam berkegiatan selalu lakukan 3 jurus ampuh:1. pakai masker.2. cuci tangan.3. jaga jarak.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 6, 8, 202006, '0.423944000', '0.010424000', '0.434368000', 217, 205, 12, 31, '0.142857143', 3),
(1985, 'https://www.instagram.com/p/CBCgPUBg1on/', 114888, 4491, '2020-06-05-11', 'coba simak apa kata kapten ri terkait akb30 (adaptasi kebiasaan baru) di 30 kegiatan di jawa barat. kesimpulan 1: saat akb jaga jarak, pake masker, cuci tangan dan tong lulumpatan.kesimpulan 2: akb adalah adaptasi kebiasaan baru bukan adaptasi kabogoh baru.', 'GraphVideo', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 5, 11, 202006, '0.919104000', '0.035928000', '0.955032000', 257, 248, 9, 40, '0.155642023', 1),
(1986, 'https://www.instagram.com/p/CBA94bgp7lj/', 90425, 2130, '2020-06-04-20', 'saya teh tidak jualan juga tidak endorse. itu mah nanti kalo sudah pensiun.tapi jika nama saya dipake untuk mengalirkan rezeki allah, silakan saja selama bisnisnya yang baik dan sesuai syariat. semoga bisnis rompi ukm yang pake nama saya ini berkah dan bangkit selama covid.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 4, 20, 202006, '0.723400000', '0.017040000', '0.740440000', 274, 269, 5, 44, '0.160583942', 0),
(1987, 'https://www.instagram.com/p/CBAASiMpUn4/', 22234, 1263, '2020-06-04-11', 'kepada warga penerima bansos dari pintu provinsi, yaitu sekitar 20 % dari total penerima yang berhak, silakan cek siapa yang mendapatakan melalui website solidaritas (bansos.pikobar.jabarprov.go.id)di sini, wargi jabar dapat melakukan pencarian data terhadap penerima bantuan sosial dan melakukan pengawasan dengan mengadukan penerima bantuan sosial yang tidak tepat sasaran.mari gunakan website solidaritas untuk berpartisipasi dalam penyelenggaraan bansos yang lebih baik dan tepat sasaran sebagai upaya menanggulangi permasalahan kesejahteraan di tengah pandemi.#pikobar #bantuansosial #bansosprovinsi #jabarlawancovid19 #solidaritas', 'GraphImage', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 4, 11, 202006, '0.177872000', '0.010104000', '0.187976000', 636, 619, 17, 74, '0.116352201', 1),
(1988, 'https://www.instagram.com/p/CA_wPCtJQmC/', 110559, 1545, '2020-06-04-09', '#hikmahdahulu, saya berpikir seiring bergeraknya waktu, seiring dengan semakin modernnya hidup ini, maka dunia semakin aman damai dan beradab. ternyata realitanya tidaklah selalu demikian seperti logika linier saya terdahulu.di era modern ini, kita menyaksikan, dunia dinterupsi oleh isis, oleh covid, oleh kebencian rasisme dan kebencian lainnya dari mereka yang tidak bisa hidup berdamai dengan perbedaan.warna kulit kita adalah takdir dari yang maha pencipta. etnisitas berbeda juga adalah takdir setiap kita.  perbedaan kemanusiaan itu adalah rahmat tuhan yang bisa menjadi kekuatan luar biasa.semoga kita yang hidup di indonesia bisa menghargai dan berdamai selalu dengan perbedaan kemanusiaan, sesuai sila ke-2 pancasila : kemanusiaan yang adil dan beradab.semoga kejadian kepada #georgefloyd di amerika serikat menjadi hikmah bagi kita. tidak boleh ada secuil asa rasisme dalam batin kita.juga hikmahnya, janganlah terlalu kagum dengan bangsa lain yang maju ekonominya. banggalah dengan bangsa kita sendiri, walaupun banyak kekurangannya. mari bersama kita sempurnakan rumah kita ini.image: @liveineverett @miamilybabycarriers', 'GraphImage', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 4, 9, 202006, '0.884472000', '0.012360000', '0.896832000', 1133, 1104, 29, 152, '0.134157105', 0),
(1989, 'https://www.instagram.com/p/CA-KSXopXth/', 113510, 1402, '2020-06-03-18', 'ujian kepada kita,khususnya umat islam terus bertambah. ibadah haji 2020 dari indonesia terpaksa ditiadakan karena pandemi covid. insya allah ini keputusan terbaik walaupun sangat pahit.saya pun sangat bersedih, karena sedianya akan mengawal 38 ribu jemaah haji jawa barat sebagai amirul hajj tentunya juga tertunda.kepada warga jawa barat yang tertunda hajinya semoga dikuatkan kesabaran dan mari terus berdoa agar pandemi covid segera berlalu dan ibadah haji bisa digantikan di tahun depan.hatur nuhun.', 'GraphSidecar', 'ridwankamil', 109, 6598, 12500000, 2020, 6, 3, 18, 202006, '0.908080000', '0.011216000', '0.919296000', 504, 496, 8, 71, '0.140873016', 2),
