(2312, 'https://www.instagram.com/p/CA4V4DcHicY/', 112479, 261, '2020-06-01-12', 'a listening heart hear angels sing. most of the time having a baby/toddler at home will give you sudden burst of sound be it from toy trumpets, drums, screams, and laughters. and there’s always two ways to listen, 1 is getting mad and frustrated at the noise, and maybe end up scolding the child which in turn will not trust you, will dislike u, will not explore the world of sound because he/she is afraid you might get mad again. or 2, you can wonder and be amazed how this little creature with such small posture with little pair of lungs can blow trumpets ? scream, and make so much noise and so happy doing it.. try to listen to what they are doing and you will find that these angels are actually singing.. the sound of children activities at home are music from nature.. well anyways.. i tried blowing the same trumpet and i am sure i have bigger lungs and probably more powerful. however i cant blow as strong and as loud and as many times compared to nastusha. it really amazes me and that actually amazes her too which in turn amazes me more.. i just can’t wait for another angel to join our choir of trumpet blowing and disney singing and many more adventures to do together. .photo by @riomotret makeup by @rama_jee hairdo by @cecilliadiana stylist by @christiotanada suit by @agusslim chelsea robes by @rendezvous.robesnastusha’s dress @little.naru', 'GraphImage', 'glennalinskie', 579, 3894, 10700000, 2020, 6, 1, 12, 202006, '1.051205607', '0.002439252', '1.053644860', 1361, 1320, 41, 242, '0.177810434', 1),
(2313, 'https://www.instagram.com/p/CA1xvzkH8n5/', 144909, 314, '2020-05-31-12', 'having a little angel is a blessing, i wake up everyday in random ways, sometimes with kisses on my face, sometimes licks on my eyes, sometimes a jump on my tummy, sometimes a pull on my hair.. sometimes a big warm hug from nastusha. and soon.. that morning blessings will double! and i just can’t wait for that to happen!! .photo by @riomotret makeup by @rama_jee hairdo by @cecilliadiana stylist by @christiotanada suit by @agusslim chelsea robes by @rendezvous.robesnastusha’s dress @little.naru', 'GraphImage', 'glennalinskie', 579, 3894, 10700000, 2020, 5, 31, 12, 202005, '1.354289720', '0.002934579', '1.357224299', 498, 473, 25, 81, '0.162650602', 0),
(2314, 'https://www.instagram.com/p/CAuUdDqnzjh/', 313033, 695, '2020-05-28-14', 'today is our 12 years 10 months being together.. blessed i am to have you. and more blessed are we to have nastusha and another angel coming our way.. i just can’t wait to embark on our beautiful sleepless nights again! taking turns and now with nastusha involved too! it’s going to be a fantastic and funny journey i can imagine! .photo by @riomotret @riomotretofficial make up @rama_jee hairdo @cecilliadianastylist @christiotanada @portiofolio dress by @bysherlyta', 'GraphImage', 'glennalinskie', 579, 3894, 10700000, 2020, 5, 28, 14, 202005, '2.925542056', '0.006495327', '2.932037383', 467, 449, 18, 75, '0.160599572', 2);
