(2315, 'https://www.instagram.com/p/CArk9eXHW9y/', 224381, 970, '2020-05-27-13', 'and here it goes, we are pregnant.blessings upon blessings is what i would describe my life after i met @chelseaoliviaa from the day we met, our wedding day, the day we knew we were pregnant, the day nastusha was born, and everyday ever since was such a bliss and full of blessings. laughter and full of love. and just when i thought life could not get any better, god had other plans. we are once again blessed with another angel, another lovely creation of god that will add to our happiness, our tribe and our family. we will be waiting for you little one.', 'GraphImage', 'glennalinskie', 579, 3894, 10700000, 2020, 5, 27, 13, 202005, '2.097018692', '0.009065421', '2.106084112', 559, 544, 15, 104, '0.186046512', 0),
