(2386, 'https://www.instagram.com/p/CCDGS7WAEQs/', 538394, 2426, '2020-06-30-13', 'a lot can happen within a week. seminggu yang lalu, melbourne masuk ke kondisi yang mulai membaik. new normal mulai diterapkan dan social distancing juga gak pernah terlewat. sampai sekitar 4 hari lalu, jumlah kasus mulai naik dan rencananya, lockdown akan dilakukan lagi di beberapa suburb yang ada di zona merah penyebaran. good thing kemarin sempet keluar to run some errands before things go south again. pas perjalanan pulang ke stasiun kereta, gue sempet foto the iconic flinders station pake realme c11 dengan fitur nightscape, dan hasilnya jadi lebih terang dan tajem.and did you know? hari ini @realmeindonesia meluncurkan #realmec11 dengan desain premium, baterai besar dan layar luas!! congratulations realme!anyways, stay safe everyone. please wear your mask. kalau gaenak badan, di rumah aja. kalau sehat dan gaada kerjaan, juga tetep di rumah aja ya. take care gang?#bateraicadasserutanpabatas #daretoleap #favoritnyaanakmuda', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 6, 30, 13, 202006, '5.079188679', '0.022886792', '5.102075472', 939, 910, 29, 139, '0.148029819', 1),
(2387, 'https://www.instagram.com/p/CBz-COTgb-H/', 365595, 1563, '2020-06-24-16', 'diawali dari inisiatif untuk membantu komunitas yang terkena dampak covid-19, team kami akhirnya terekspos dengan keadaan komunitas orang dengan gangguan mental yang selama masa pandemi ini, semakin terlantar karena donatur berhenti memberikan donasi selama 4-5 bulan terakhir.hari ini, penggalangan dana untuk yayasan pondok kasih bersaudara akan dimulai dan disiarkan live dari melbourne dan jakarta. semakin banyak donasi yang terkumpul, semakin besar kita bisa membantu.selain berfungsi sebagai donasi, realme x svmmerdose charity online session ini juga didedikasikan untuk teman-teman yang mungkin mulai kangen dengan konser musik. kita persiapin beberapa kejutan untuk kalian jadi jangan sampai kelawatan.jam 19:00 wib live dari youtube dan instagram realme indonesia and svmmerdose. more info click on the post. sampai bertemu x', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 6, 24, 16, 202006, '3.449009434', '0.014745283', '3.463754717', 836, 820, 16, 115, '0.137559809', 0),
(2388, 'https://www.instagram.com/p/CBfLn4IDWsf/', 463051, 2253, '2020-06-16-14', 'beberapa waktu yang lalu, @realmeindonesia sempet ngirimin prototype handphone terbaru mereka buat gue cobain. berhubung situasi di melbourne udah mulai membaik in terms of new cases, kita udah mulai diperbolehkan keluar dengan aturan-aturan social distancing yang masih harus tetap dilakukan. nah foto ini diambil waktu keluar rumah pake handphone yang waktu itu belum ada yang punya?but finally!!! hari ini resmi diluncurkan #realmenarzo sebagai seri terbaru di keluarga realme dengan harga yang super affordable dengan kualitas powerful dan trendy! silahkan di coba langsung buat yang penasaran sama handphonennyadukung terus realme untuk selalu jadi brand teknologi #favoritntaanakmuda di indonesia. yang penasaran dengan info lebih lanjut, cek @realmeindonesia untuk harga dan waktu pembeliannya ya!#daretoleap #feelthepower', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 6, 16, 14, 202006, '4.368405660', '0.021254717', '4.389660377', 829, 810, 19, 112, '0.135102533', 0),
(2389, 'https://www.instagram.com/p/CBVXMu4gweF/', 1127774, 15463, '2020-06-12-18', 'sebagai mahasiswa, duduk depan laptop berjam-jam itu udah jadi kebiasaan sehari-hari buat gue. gak jarang kadang-kadang suka sampe lupa waktu. kalau gak diingetin break dulu mungkin bablas aja sampe tugas atau belajarnya selesai, baru bisa ngerjain yang lain. semenjak adanya realme watch ini, gue berasa jadi punya asisten pribadi yang selalu ngingetin buat take a break once in a while, diingetin minum, bahkan diingetin buat berdiri kalau udah kelamaan duduk! (anaknya kalau depan laptop emg lost sama waktu). realme watch juga fitur yang ngasih tau detak jantung dan kadar oksigen dalam darah loh. nah buat dengerin lagu pas nulis essay dan research, atau nonton live lectures di weekdays, gue pake realme buds air neo dengan super low latency dan easy connect, bikin belajar jadi lancar. buat yang penasaran sama dua gadget baru dari realme ini, jangan kelewatan launch eventnya tanggal 16 juni jam 13:00 wib di seluruh social media platformnya @realmeindonesia okay bye brb nugas lagi xx#timetobesmarter #truewirelessrealchoice #daretoleap', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 6, 12, 18, 202006, '9.999999999', '0.145877358', '9.999999999', 1045, 1019, 26, 159, '0.152153110', 1),
(2390, 'https://www.instagram.com/p/CBDWYfxAwE5/', 641041, 3878, '2020-06-05-18', 'belakangan ini lagi sering mikirin kira-kira mau ngapain kalo pandemi ini udah selesai. idenya sih banyak, mulai dari ketemu temen, makan di luar, camping di wilderness, atau sewa rumah bareng temen di countryside! kayak foto yang diatas, ini foto waktu (hampir) sunset di salah satu accomodation di countryside victoria. fotonya diambil pake realme x3 superzoom yang punya fitur 60x persicope super zoom dan starry mode. jadi kalau lagi camping, gak perlu khawatir kalau foto bintang di malam hari gak keliatan! ga sabar untuk bisa keluar lagi. buat yang penasaran sama realme x3 super zoom, set reminder buat tonton launch eventnya tanggal 16 juni 2020, jam 13:00 wib di youtube, facebook, instagram dan twitter @realmeindonesia ya!', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 6, 5, 18, 202006, '6.047556604', '0.036584906', '6.084141509', 734, 712, 22, 115, '0.156675749', 1),
