(2394, 'https://www.instagram.com/p/B-G2z-xA_MA/', 306545, 1476, '2020-03-24-13', '4 hari yang lalu gue dikontak oleh @bazaarindonesia untuk menyuarakan campaign #socialdistancing di rumah masing-masing dalam rangka menyatukan suara untuk terus waspada terhadap virus covid-19. lewat video ini, kita berharap untuk meningkatkan kesadaran terhadap pentingnya memperlambat penyebaran dan melandaikan kurvanya dengan berdiam diri di rumah.untuk mereka yang masih harus bekerja di luar rumah, terutama para tenaga medis yang sekarang berada di garda terdepan melawan covid-19, doa dan apresiasi kami selalu bersama kalian.they stay at work for us, we stay at home for themvideo by farhanraf #bazaarindonesia #lawancovid19 #mralawancovid19 #selamatdirumah', 'GraphVideo', 'iqbaal.e', 784, 157, 10600000, 2020, 3, 24, 13, 202003, '2.891933962', '0.013924528', '2.905858491', 667, 651, 16, 89, '0.133433283', 1),
(2395, 'https://www.instagram.com/p/B-GuXIfAOya/', 461801, 1786, '2020-03-24-12', 'congratulations buat @realmeindonesia atas pencapaiannya sebagai brand #favoritnyaanakmuda, dan hadirnya keluarga baru #realme6 #realme6pro. always a pleasure working with these guys.terus dukung realme untuk menghadirkan produk trendy dengan teknologi terbaru untuk semua anak muda di indonesia.cek juga @realmeindonesia ya! ada kejutan seru buat kalian!photo was taken two weeks ago in a park in melbourne.#64mpprocameraprodisplay #daretoleap', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 3, 24, 12, 202003, '4.356613208', '0.016849057', '4.373462264', 444, 430, 14, 55, '0.123873874', 0),
(2396, 'https://www.instagram.com/p/B95c7vLAlWB/', 376486, 4886, '2020-03-19-09', 'halo teman-teman semua!semoga semuanya tetap dalam keadaan sehat dan tetap #dirumahaja ya. nah, hari ini gue punya berita baik nih. realme 6 dan realme 6 pro akan segera hadir buat kalian semua! kamera 64mp dijamin bisa bikin foto kamu makin keren. pastikan kalian tonton keseruan live streamingnya tanggal 24 maret, jam 10.30 wib, karena banyak kejutannya! so, langsung cek di @realmeindonesia ya!in the meantime, stay well everyone!#64mpprocameraprodisplay #daretoleap', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 3, 19, 9, 202003, '3.551754717', '0.046094340', '3.597849057', 470, 451, 19, 68, '0.144680851', 3),
(2397, 'https://www.instagram.com/p/B9rQ0ieAzn_/', 272338, 2391, '2020-03-13-20', 'throwback sedikit before the show #dfilwm2020 kemarin di bandung. check this video out, gue seharian persiapan terus manggung bareng @svmmerdose didokumentasikan pake realme 6 pro dengan 6 camera yang sabi banget.tonton launch eventnya realme 6 dan realme 6 pro, tanggal 24 maret 2020, jam 10:30. untuk lebih lengkap check langsung di @realmeindonesia#6camerasprodisplay #daretoleap', 'GraphVideo', 'iqbaal.e', 784, 157, 10600000, 2020, 3, 13, 20, 202003, '2.569226415', '0.022556604', '2.591783019', 382, 370, 12, 53, '0.138743455', 5),
(2398, 'https://www.instagram.com/p/B9BIYZWgrsZ/', 666269, 3827, '2020-02-26-12', 'don’t fall in love with me tour has finally ended. throwback to 2017 when this all was just “eh tur seru kali ya”, and now it’s done. we made it. thank you to every single one involved in this thing. i know we all put our heart and mind into it. otherwise the tour wouldn’t be possible. thank you for believing in us, my dreams, our vision, and music. this is just the beginning. here are some pictures from the last city we played, bandung. you guys were so sweet can’t wait to do more shows xxxx', 'GraphSidecar', 'iqbaal.e', 784, 157, 10600000, 2020, 2, 26, 12, 202002, '6.285556604', '0.036103774', '6.321660377', 497, 477, 20, 97, '0.195171026', 1),
