(2403, 'https://www.instagram.com/p/B8of2M7gJ5s/', 1151090, 16653, '2020-02-16-22', 'dilan circa 1991. difoto oleh wati pake kamera tustel waktu tahun baruan katanya. film cerita jaman baheulanya di hari ketiga penayangan sudah ditonton lebih dari 1.2 juta orang. terimakasih banyak buat yang sudah nonton. yang belum, silahkan ke bioskop terdekat supaya paham kenapa dilan itu dilan :))', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 2, 16, 22, 202002, '9.999999999', '0.157103774', '9.999999999', 302, 293, 9, 47, '0.155629139', 0),
