(2406, 'https://www.instagram.com/p/B8jTkf9g1D7/', 603898, 4706, '2020-02-14-22', 'selama ini gue tuh kayak hidup di dua dunia: musik dan akting. tahun lalu, gue masih berfikir kalau harus pilih salah satu. ternyata enggak mereka saling melengkapi. dengan berakting, gue bisa jadi pribadi yang lain dari diri sendiri. tapi di musik, disitulah gue bener-bener ngerasa jadi diri sendiri—honest, raw, and free. kemarin film gue mulai tayang. besok, show pertama dari tur 6 kota bareng @svmmerdose juga akhirnya di mulai. semua prosesnya dilakukan di waktu yang bersamaan. gue nervous banget sih. gak pernah kebayang punya show sendiri soalnya. untung libur kuliah dan gak tipes jadi bisa tetep ngerjain tur di sela-sela kegiatan yg lain. excited banget untuk akhirnya memperkenalkan musik svmmerdose ke khalayak yang lebih luas. terlebih setelah berdiri sendiri, semuanya terasa lebih natural dan organik—semoga terasa besok dan di kota-kota lainnya. terimakasih untuk supportnya yang gak putus-putus dari teman-teman semua. you all know who you are. sampai bertemu besok di the pallas! #dfilwm2020 #svmmerdosetour2020', 'GraphSidecar', 'iqbaal.e', 784, 157, 10600000, 2020, 2, 14, 22, 202002, '5.697150943', '0.044396226', '5.741547170', 1032, 998, 34, 154, '0.149224806', 1),
