(2408, 'https://www.instagram.com/p/B8eH707A_hG/', 1186503, 14030, '2020-02-12-21', 'still photos untuk shooting kemarin. kira-kira shooting apa ya? buat kalian yang penasaran, jangan sampai kelewatan buat nonton film milea, suara dari dilan ya??‍♂️ #realmec3 #triplecameragamemonster #realmexmilea #daretoleap', 'GraphSidecar', 'iqbaal.e', 784, 157, 10600000, 2020, 2, 12, 21, 202002, '9.999999999', '0.132358491', '9.999999999', 225, 211, 14, 28, '0.124444444', 0),
(2409, 'https://www.instagram.com/p/B8JRZXLAye4/', 657023, 3398, '2020-02-04-19', 'hiiii. gue mau update tentang venue tour don’t fall in love with me 2020. swipe ke kiri untuk list venuenya.nah, berhubung kmrn banyak yang cerita tentang beberapa dari temen-temen ada yang kesulitan dalam proses pembelian tiket, hari ini juga kita buka direct selling untuk memudahkan dapetin tiket tour kita. untuk info lebih lanjut, langsung ke @svmmerdose ya. see you semua! #dfilwm2020 #svmmerdosetour2020', 'GraphSidecar', 'iqbaal.e', 784, 157, 10600000, 2020, 2, 4, 19, 202002, '6.198330189', '0.032056604', '6.230386792', 410, 396, 14, 62, '0.151219512', 0),
