(2411, 'https://www.instagram.com/p/B8BooLpgdBa/', 783762, 3828, '2020-02-01-20', 'h-14 menuju show pertama di tour don’t fall in love with me. jakarta akan jadi show pembuka untuk 5 kota lainnya. belakangan ini lagi sibuk dan serius banget ngerjain materi, konsep, aransemen, promo sampe kadang tidur aja lupa caranya. deg-degan banget. tapi apapun itu, kita pastiin kalau yang dateng di tanggal 15 nanti bisa dapet experience terbaik. karena band gue jarang manggung (kuliahnya jauh bo$$), sekalinya dapet kesempatan gue mau pastiin semuanya lancar dan experience yang di kasih ke penonton juga memorable. ini akan jadi show terbesar yang pernah kita lakukan jadi pastiin hadir dan liat sendiri apa yang gue omongin. link on my bio. #dfilwm2020 #svmmerdosetour2020', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2020, 2, 1, 20, 202002, '7.393981132', '0.036113208', '7.430094340', 683, 661, 22, 107, '0.156661786', 2),
