(2435, 'https://www.instagram.com/p/B3O6tQ5gzy4/', 622302, 4973, '2019-10-05-17', 'art installation saya bersama @tumitravel sudah bisa dikunjungi di main atrium senayan city mulai hari ini sampai 13 oktober 2019.//tema yang saya angkat adalah anxiety. ide ini lahir dari kecemasan saya terhadap isu mental health yang dirasa kurang dibicarakan oleh sekitar padahal nyata adanya.//tidak sendiri, saya juga berkolaborasi dengan @faridstevy, @jozz_felix, juga @mejabunstudio yang membantu saya menerjemahkan perspektif saya tentang anxiety dalam bentuk tulisan, foto, juga video. //silahkan didatangi dan dirasakan segala ketidaknyamanannya. semoga lewat instalasi ini, kita semua bisa lebih paham tentang pentingnya mental health dan tidak lagi menganggapnya sebagai hal yang sepele.', 'GraphSidecar', 'iqbaal.e', 784, 157, 10600000, 2019, 10, 5, 17, 201910, '5.870773585', '0.046915094', '5.917688679', 699, 677, 22, 94, '0.134477825', 1),
