(2443, 'https://www.instagram.com/p/B1na3PUAkUU/', 830726, 5815, '2019-08-26-12', '??? ?????????dari dulu selalu berfikir: kalau sampai nanti ada project yang keterlibatan saya terjadi dibalik layar, saya gak akan pake nama “iqbaal ramadhan”. lalu pertanyaannya: “kenapa max tollenaar?”//ini nama pena yang minke gunakan ketika beliau memuat tulisan-tulisannya dalam bahasa belanda di koran belanda juga. minke sadar atas kemampuan dan bakatnya, tapi beliau juga faham kalau menggunakan nama indo-nya, tulisan-tulisan beliau—sebagus apapun tidak akan pernah dimuat hanya karena nama aslinya.//saya rasa ini sangat relatable dengan apa yang saya rasakan. nama “iqbaal ramadhan” sudah saya pakai sebagai stage name sedari saya kecil. saya kira, akan lebih bijak kalau nama “belakang layar” saya diganti menjadi yang lain. supaya orang benar-benar bisa menghargai apa-apa yang saya buat, tanpa harus menyepelekan atau menggampangkan karena nama asli saya, yang setiap orang pikirannya beda-beda ketika disebutkan.//makanya, saya memutuskan untuk menggunakan nama “max tollenaar” sebagai nama pena saya juga, ketika bekerja di belakang layar.//supaya lebih faham konteks dari nama “max tollenaar”, saksikan ???? ??????? di bioskop hari ini. //debut karir saya sebagai “max tollenaar” juga sudah bisa disaksikan di youtube. ???? ?????? ?? ???.', 'GraphSidecar', 'iqbaal.e', 784, 157, 10600000, 2019, 8, 26, 12, 201908, '7.837037736', '0.054858491', '7.891896226', 1255, 1201, 54, 176, '0.140239044', 0),
