(2445, 'https://www.instagram.com/p/B1HFmdrghqT/', 247425, 3313, '2019-08-13-23', 'we were really excited to open for @thisislany tonight, but due to what happened (which was completely out of our hands) now we\'re not so sure if they would still let us perform tomorrow. we honestly need your support to show how excited you guys are to see us--as the local musician opening for your favorite band. show us your support by reposting this with the hashtag #svmmerdoseforlany#supportlocalmusicians //sebenarnya kami sudah siap dan sangat menantikan untuk tampil malam ini sebagai band pembuka untuk lany. tapi dengan kendala yang terjadi di luar kendali kami, sekarang kami belum punya kepastian apakah kami tetap menjadi band pembuka untuk besok.kami butuh dukungan kalian dengan cara repost postingan ini dengan hashtag #svmmerdoseforlany#supportlocalmusicians', 'GraphImage', 'iqbaal.e', 784, 157, 10600000, 2019, 8, 13, 23, 201908, '2.334198113', '0.031254717', '2.365452830', 777, 759, 18, 117, '0.150579151', 0),
