(2448, 'https://www.instagram.com/p/B1BNrZVghGm/', 414984, 3150, '2019-08-11-16', 'look, all im saying from the bottom of my heart is a massive thank you to everyone who came out and supported @svmmerdose’s debut album “she / her / hers” showcase last night.//still in awe of how my friends liked and enjoyed the album along with the live performance of it. we played 10 songs (which is all of them from the album) and it turned out to be one of the best night of my life.// unlimited shoutout to svmmerdose team bapak, ibu, omen, ka sharra, sis ayu, amel, zidny, and @mejabunstudio who made this possible for us. to @reytobink, @samsooy, and @edwardlianggono for making the music comes alive on stage. to @sanisanisani for masterfully producing the album. to the lucky fans who listen and stream us the most on spotify. to you who still believes in me and my music cause without you i’d be doomed by now so thank you thank you thank you.//something is also coming out tonight at 7 pm—something i directed along with @tarrarin as the co director. stay tuned as there will be more posts coming up tonight!?//photos by: @nareend', 'GraphSidecar', 'iqbaal.e', 784, 157, 10600000, 2019, 8, 11, 16, 201908, '3.914943396', '0.029716981', '3.944660377', 1043, 996, 47, 187, '0.179290508', 2),
