(2652, 'https://www.instagram.com/p/B_O7POuJ79x/', 48758, 514, '2020-04-21-13', 'tanggal 21 april ku kini sepitanggal 21 april ku kini sunyisudah 2 taun ku merasa begini.. dibalik tawa tiwi yang kuberitak banyak yang tau jika air mata ini masi menetes 3x seharisampai detik ini.. ini hari kelahiranmu, duhai kartiniku..yang memperkenalkanku pada indahnya duniayang lindungiku dari kesusahan jiwa ragaapa kabar sayang, sedang apa disanakami disini sedang pilu akan pandemi.. tiap-tiap kali kudengar berita ada yang dipasangkan ventilator lalu berpulang,kuingat kala itu...berbekal ventilator di hari-hari terakhirmu..menit-menit itu, detik-detik terperih dalam hidupkukuhantarkan belahan jiwaku, cintaku, dirimu, pulang dalam genggamanku.. maafkan aku yaa raab, jikalau masih menangisi ketentuanmu..aku hanya rindu, dengan ciptaan muyang kusebut ibuku.. 21 april ku tak kan pernah lagi samatapi kukan coba kumpulkan semua kekuatan yang kupunya, untuk bisa selalu alirkan doa dan amalan untukmu ibu.. al fatihah untukmu..selalu... #ibukukartiniku#ayudewistory', 'GraphImage', 'mrsayudewi', 575, 4944, 10400000, 2020, 4, 21, 13, 202004, '0.468826923', '0.004942308', '0.473769231', 976, 934, 42, 129, '0.132172131', 4),
(2653, 'https://www.instagram.com/p/B_Mhu8mpS6m/', 23118, 203, '2020-04-20-15', 'setiap ada yang nanya:kalo ini udah selesai, mau ngapain mba?nanti kalo semua sudah berlalu,mau pergi kemana bu ayu?ada kepikiran apa mba kalo semuanya udah selesai mba?jujur...ku ga kepikiran apa-apa, atau andai-andai saat pandemi udah selesai mau kemana, ngapain, jadi apa.karna yang ada di pikiran cuma pingin setiap harinya semua sehat, dari anak-anak, orang tua, suami, keluarga, orang rumah, tetangga, sahabat, temen, sekitar, semua tenaga medis, semua yg lagi sakit, sama bumi ini. udah.mungkin kedengeran “old school” atau “kuno” atau juga “ko kaya ga memotivasi”. tapi yang ada di pikiran justru, yang ada sekarang = kesehatan, itu yang paling di syukuri. karna  disaat semuanya tampak terbatas tapi kita tetep bisa bersyukur dan tetep bisa bantu yang lagi butuh, semua rasanya tetep cukup dan lengkap.inget jg kan, kl lg kajian pun, kita slalu diingetin, saat semakin kita banyak memberi, semakin banyak juga kita diberi.. ada kata-kata nya @melaney_ricardo yg dari dulu selalu aku inget. “kita itu ibarat keran, di bawah kita banyak yang nadahin tu keran, kalau kita tetep ngalirin tu keran buat yang butuh, tuhan ga akan berhentiin aliran tu keran, malah akan di buat lebih deres lagi alirannya”ga cuma beri harta, tapi doa, perhatian, senyuman, semua dan hal-hal baik yang kita kasi tulus, pasti kembalinya pun akan bagus.kalopun lagi ga bisa beri apa-apa untuk org lain krna mungkin lagi “drop” banget baik badan maupun jiwa, bersyukur juga udah jadi satu hal baik yang bisa kita lakuin?jadi,udah bersyukur apa hari ini????#ayudewistory', 'GraphImage', 'mrsayudewi', 575, 4944, 10400000, 2020, 4, 20, 15, 202004, '0.222288462', '0.001951923', '0.224240385', 1550, 1474, 76, 241, '0.155483871', 0),
